import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('API_ENDPOINT')
      .then(response => {
        setData(response.data.result);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div className="App">
      {data.length > 0 ? (
        data.map((item, index) => (
          <div key={index}>
            <h2>{item.name}</h2>
            <p>{item.address}</p>
            <p>Charger Type: {item.chargerType}</p>
            <p>Operator: {item.operatorName}</p>
            <p>Output: {item.output}</p>
            <p>Kind Detail: {item.kindDetail}</p>
          </div>
        ))
      ) : (
        <p>No data available</p>
      )}
    </div>
  );
}

export default App;
